<p>
  Notre histoire
  Notre guilde au sens Alpha du terme a vu le jour en 2018 avec la guilde [DFR1] Les b\xE9liers.<br/>
  Nous \xE9tions la 1e guilde francophone la plus active gr\xE2ce \xE0 la limite infinie du nombre de membres dans la guilde, nous \xE9tions auparavant 1400+ membres et trouvions facilement des joueurs en jeu avec le canal de guilde. <br/>
  Les temps et les mises \xE0 jour ont pass\xE9 pour laisser place \xE0 un syst\xE8me \xE0 100 place Max. Nous avons donc d\xFB revoir compl\xE8tement la guilde est son int\xE9r\xEAt.<br/><br/>
  Avec l'arriv\xE9e du Gauntlet nous avons sur la 1e saison pas mal jou\xE9 mais nous n'avions pas trop forc\xE9 voyant comment les guildes internationales  dominaient la sc\xE8ne.<br/>
  Apr\xE8s plusieurs saisons pass\xE9es et la motivation \xE0 nouveau pr\xE9sente, c'est en saison 6 (ao\xFBt 2023) que nous reprenons du poil de la b\xEAte.<br/>
  C'est \xE0 dire : Nettoyage complet de la guilde par une dissolution suivi d'une recr\xE9ation instantan\xE9e pour palier au bug des "Ghost Members"...<br/><br/>
  Nous avons actuellement un nouveau syst\xE8me pour suivre nos membres qui participent (ou non) et ainsi faire en sorte que chaque personne ne se sentent pas exploit\xE9 par les autres membres inactifs.<br/>
  (Nous avions auparavant une politique de recrutement plus que laxiste et au final personne ne participait. Nous avons donc chang\xE9 notre fusil d'\xE9paule et proposons donc ce nouveau concept qui pour l'instant marche bien puisqu'une semaine apr\xE8s nous sommes mont\xE9s Top20 au palier 135.<br/>
  Depuis, nos classement ce sont stabilis\xE9s dans le Top20<br/><br/>
  <u>Pourquoi nous</u>?<br/>
  Eh bien comme dit pr\xE9c\xE9demment, fort d'un discord communautaire FR de ~7000 membres, nous avons donc un pilier central d'activit\xE9 et fait de notre guilde un endroit propice pour tout francophone qui se respecte.
  Vous l'avez donc compris, notre guilde n'est pas pr\xEAte de rendre l'\xE2me et si vous recherchez une guilde FR c'est LA guilde \xE0 ne pas rater.
</p>
